pub fn blocks_1000() -> impl Iterator<Item = Command> {
    TRANSACTIONS.iter().enumerate().map(|(i, tx)| {
        let i = i as u64;
        let randao = i.to_be_bytes().repeat(4);

        StartBlockBuild {
            payload_attributes: Payload {
                timestamp: U64::from_limbs([1745341891u64 + i]),
                prev_randao: B256::new(randao.try_into().unwrap()),
                suggested_fee_recipient: Address::new(hex!(
                    "4200000000000000000000000000000000000011"
                )),
                withdrawals: Vec::new(),
                parent_beacon_block_root: B256::ZERO,
                transactions: vec![tx.clone()],
                gas_limit: U64::from_limbs([30000000u64]),
            },
            payload_id: PayloadId::from_limbs([i]),
        }
    })
}

